import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { Link} from "react-router-dom";
function BannerServices() {
  const settings = {
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
    dots: true,
  };
  return (
    <div className="slider lg:mx-6 lg:p-6">
      <Slider {...settings}>
      <div className="card bg-red-200 text-center font-bold  h-48  w-24  px-12 rounded-lg">
            <Link to="/ourservices" > <h1 className="mt-4">GOLD LOAN</h1></Link>
            </div>

            <div className="card bg-red-200  text-center font-bold  px-12  h-48 rounded-lg">
            <Link to="/ourservices" ><h1  className="mt-4">OLD GOLD BUYING</h1></Link>
            </div>

            <div className="card bg-red-200  text-center font-bold px-12   h-56 rounded-lg">
            <Link to="/ourservices" ><h1  className="mt-4">TAKING MORTGAGE GOLD FROM BANK </h1></Link>
            </div>

            <div className="card bg-red-200  text-center font-bold px-12  h-56 rounded-lg">
            <Link to="/ourservices" ><h1  className="mt-4">AGRICULTUTE LOAN</h1></Link>
            </div>

            <div className="card bg-red-200 text-center font-bold   px-12  h-56 rounded-lg">
            <Link to="/ourservices" ><h1  className="mt-4">PERSONAL LOAN</h1></Link>
            </div>



      </Slider>
    </div>
  );
}
export default BannerServices;
